import './App.css';
import Menu from './components/Menu/Menu'
import Card from './components/Card/Card'

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <div className='menu'>
        <Menu></Menu>
      </div>
      <Card title={"Pikachu"} description={"Pokémon de tipo Eléctrico de la primera generación, número 25 en el Pokédex nacional."} textButton={"Ver mas"}></Card>
      </header>
    </div>
  );
}

export default App;
